\begin{itemize}
\item Requires known $T^{-1}$
\item Can compute $\hat p_X$ for arbitrary $x$ samples
\end{itemize}

\begin{itemize}
\item Does not require explicit $T^{-1}$
\item Force $T$ to be bijective through regularization
\item $\hat p_X$ can only be evaluated when sampling
\item $\hat p_X(T(z)) = p_Z(z) \cdot |\det J_T(z)|^{-1}$
\end{itemize}
